create schema if not exists tp2_GRUPO_03;

create table if not exists tp2_GRUPO_03.genre(
	id bigserial primary key,
	name varchar(20) not null unique
);

create table if not exists tp2_GRUPO_03.publisher(
	id bigserial primary key,
	name varchar(30) not null unique
);

create table if not exists tp2_GRUPO_03.author(
	id bigserial primary key,
	name varchar(30) not null unique
);

create table if not exists tp2_GRUPO_03.book( 
    id bigserial primary key,
    title varchar(60) not null,
    isbn  varchar(13) not null unique,
    publication_date varchar(4) not null,
    synopsis varchar(1100) not null,
    cover_image varchar(300000) not null,
    amount int,
    language varchar(2) not null,
    genre bigint references tp2_GRUPO_03.genre(id),
    publisher bigint references tp2_GRUPO_03.publisher(id),
    author bigint references tp2_GRUPO_03.author(id)
);

create table if not exists tp2_GRUPO_03.user (
	id bigserial primary key,
	name varchar(30) not null,
	password varchar(20) not null,
	email varchar(50) not null unique
);

create table if not exists tp2_GRUPO_03.user_books(
	id bigserial primary key,
	user_id bigint references tp2_GRUPO_03.user(id),
	book_id bigint references tp2_GRUPO_03.book(id),
	borrower_id bigint,
	borrowed_date Date
);

