INSERT INTO tp2_GRUPO_03.book (title, isbn, publication_date, synopsis, cover_image, amount, language, genre, publisher, author)
values
	('Carrie', '8851907784643', '1974', 'In the Maine town of Chamberlain in the year 1979, Carietta Carrie White is a 16-year-old girl who is a target of ridicule for her frumpy appearance and unusual religious beliefs, instilled by her despotic mother, Margaret. One day, Carrie has her first period while showering in the girls'' locker room after a physical education class. Carrie is terrified, having no understanding of menstruation as her mother, who despises everything related to intimacy, never told her about it. While Carrie believes she is dying, her classmates, led by a wealthy, popular girl named Chris Hargensen, insult her and throw tampons and sanitary napkins at her. The gym teacher, Rita Desjardin, helps Carrie clean up and tries to explain. On the way home, Carrie practices her unusual ability to control objects from a distance. The only time she recalls using this power was when she was three years old and caused stones to fall from the sky by her house. Once Carrie gets home, Margaret furiously accuses Carrie of sin and locks her in a closet so that she may pray.', 
 	'data:image/jpeg;base64,', 0, 'en', 1, 3, 2),
 	('The Green Mile', '3376014942562', '1996', 'Featuring a first-person narrative told by Paul Edgecombe, the novel switches between Paul as an old man in the Georgia Pines nursing home writing down his story in 1996, and his time in 1932 as the block supervisor of the Cold Mountain Penitentiary death row, nicknamed The Green Mile for the color of the floor''s linoleum. This year marks the arrival of John Coffey, a 6 ft 8 in (2.03 m) tall powerfully built black man who has been convicted of raping and murdering two young white girls. During his time on the Mile, John interacts with fellow prisoners Eduard Del Delacroix, a Cajun arsonist, rapist, and murderer; and William Wharton (Billy the Kid to himself, Wild Bill to the guards), an unhinged and dangerous multiple murderer who is determined to make as much trouble as he can before he is executed. Other inhabitants include Arlen Bitterbuck, a Native American convicted of killing a man in a fight over a pair of boots; Arthur Flanders, a real estate executive who killed his father to perpetrate insurance fraud; and Mr. Jingles, a mouse, to whom Del teaches various tricks.', 
 	'data:image/jpeg;base64,', 0, 'en', 11, 2, 2),
 	('Pet Sematary', '5145602953544', '1983', 'Louis Creed, a doctor from Chicago, is appointed director of the University of Maine''s campus health service. He moves to a large house near the small town of Ludlow with his wife Rachel, their two young children, Ellie and Gage, and Ellie''s cat, Winston Churchill (Church). From the moment they arrive, the family runs into trouble: Ellie hurts her knee, and Gage is stung by a bee. Their new neighbor, an elderly man named Jud Crandall, comes to help. He warns Louis and Rachel about the highway that runs past their house, which is frequented by speeding trucks.', 
 	'data:image/jpeg;base64,', 0, 'en', 1, 3, 2),
 	('The Shining', '3162952518642', '1977', 'Jack Torrance, his wife Wendy, and their five-year-old son Danny move into the hotel after Jack accepts the position as winter caretaker. Jack is an aspiring writer[1] and recovering alcoholic with anger issues which, prior to the story, had caused him to accidentally break Danny''s arm and lose his position as a teacher after assaulting a student. Jack hopes that the hotel''s seclusion will help him reconnect with his family and give him the motivation needed to work on a play. Danny, unknown to his parents, possesses psychic abilities referred to as shining, which enable him to read minds and experience premonitions as well as clairvoyance. The Torrances arrive at the hotel on closing day and are given a tour by the manager. They meet Dick Hallorann, the chef, who possesses similar abilities to Danny''s and helps to explain them to him, giving Hallorann and Danny a special connection. The remaining staff and guests depart the hotel, leaving the Torrances alone in the hotel for the winter.', 
 	'data:image/jpeg;base64,', 0, 'en', 11, 5, 2),
 	('It', '7021879085087', '1986', 'During a rainstorm in Derry, Maine, a six-year-old boy named Georgie Denbrough sails a paper boat along the rainy streets before it washes down into a storm drain. Looking in the drain, Georgie encounters a clown who introduces himself as Pennywise the Dancing Clown. Georgie is enticed by Pennywise to reach into the drain and retrieve his boat, where the clown rips his arm off, leaving him to die.
	The following June, an overweight eleven-year-old boy named Ben Hanscom is harassed by a bully named Henry Bowers and his gang on the last day of school, escaping into the marshy wasteland known as the Barrens. There, Ben befriends an asthmatic hypochondriac named Eddie Kaspbrak and Stuttering Bill Denbrough, Georgie''s elder brother. The three boys later befriend fellow misfits Richie Tozier, Stanley Stan Uris, and Beverly Marsh, and refer to themselves as The Losers Club. As the summer draws on, the Losers each encounter Pennywise in terrifying manifestations: a mummy on a frozen canal to Ben, a fountain of blood (that only children can see).', 
 	'data:image/jpeg;base64,', 0, 'en', 1, 2, 2),
 	('The Sun Also Rises', '4666926904459', '1926', 'With his wife Hadley Richardson, Hemingway first visited the Festival of San FermÃ­n in Pamplona in 1923, where he was following his recent passion for bullfighting. The couple returned to Pamplona in 1924âenjoying the trip immenselyâthis time accompanied by Chink Dorman-Smith, John Dos Passos and Donald Ogden Stewart and his wife. The two returned a third time in June 1925 and stayed at the hotel of his friend Juanito Quintana. That year, they brought with them a different group of American and British expatriates, Hemingway''s Michigan boyhood friend Bill Smith, Stewart, recently divorced Duff, Lady Twysden, her lover Pat Guthrie and Harold Loeb. Hemingway''s memory spanning multiple trips might explain the inconsistent time frame in the novel indicating both 1924 and 1925.In Pamplona, the group quickly disintegrated. Hemingway, attracted to Duff, was jealous of Loeb, who had recently been on a romantic getaway with her; by the end of the week the two men had a public fistfight.', 
 	'data:image/jpeg;base64,', 0, 'en', 4, 1, 1),
 	('For Whom the Bell Tolls', '7985113525052', '1940', 'For Whom the Bell Tolls is a novel by Ernest Hemingway published in 1940. It tells the story of Robert Jordan, a young American volunteer attached to a Republican guerrilla unit during the Spanish Civil War. As a dynamiter, he is assigned to blow up a bridge during an attack on the city of Segovia.
	It was published just after the end of the Spanish Civil War (1936â1939), whose general lines were well known at the time. It assumes the reader knows that the war was between the government of the Second Spanish Republic, which many foreigners went to Spain to help and which was supported by the Communist Soviet Union, and the Nationalist faction, which was supported by Nazi Germany and Fascist Italy. In 1940, the year the book was published, the United States had not yet entered the Second World War, which had begun on September 1, 1939, with Nazi Germany''s invasion of Poland.', 
 	'data:image/jpeg;base64,', 0, 'en', 6, 3, 1),
 	('The Old Man and the Sea', '8419580148230', '1974', 'Santiago is an aging, experienced fisherman who has gone eighty-four days without catching a fish. He is now seen as salao (colloquial pronunciation of salado, which means salty), the worst form of unlucky. Manolin, a young man whom Santiago has trained since childhood, has been forced by his parents to work on a luckier boat. Manolin remains dedicated to Santiago, visiting his shack each night, hauling his fishing gear, preparing food, and talking about American baseball and Santiago''s favorite player, Joe DiMaggio. Santiago says that tomorrow, he will venture far out into the Gulf Stream, north of Cuba in the Straits of Florida to fish, confident that his unlucky streak is near its end.', 
 	'data:image/jpeg;base64,', 0, 'en', 5, 6, 1),
 	('A Farewell to Arms', '6611315799096', '1929', 'A Farewell to Arms is a novel by American writer Ernest Hemingway, set during the Italian campaign of World War I. First published in 1929, it is a first-person account of an American, Frederic Henry, serving as a lieutenant (tenente) in the ambulance corps of the Italian Army. The title is taken from a poem by the 16th-century English dramatist George Peele.
	The novel describes a love affair between the expatriate Henry and an English nurse, Catherine Barkley. Its publication ensured Hemingway''s place as a modern American writer of considerable stature. The book became his first best-seller and has been called the premier American war novel from that debacle World War I', 
 	'data:image/png;base64,', 0, 'en', 7, 5, 1),
 	('To Have and Have Not', '3626834789477', '1937', 'Hemingway depicts Harry as an ordinary working man of the Depression Era, forced by dire economic forces into the black-market activity of running contraband between Cuba and Florida. A wealthy fishing charter customer (one of the Have''s) bilks Harry by slipping away without paying after a three-week fishing trip, leaving Harry destitute. Stuck in Havana and motivated by the need to support his family, Harry then himself turns to crime. He makes a fateful decision to swindle would-be Chinese immigrants seeking passage into Florida from Cuba. Instead of transporting them as agreed, he murders the Chinese middle-man and puts the men ashore in Cuba. Harry begins to ferry different types of illegal cargo between the two countries, including alcohol and Cuban revolutionaries. These events alternate with chapters that describe the dissolute lives of wealthy yacht owners. The Great Depression features prominently in the novel, forcing depravity and hunger on the poor residents of Key West (the Have Not''s) who are referred to locally as Conchs.', 
 	'data:image/jpeg;base64,', 0, 'en', 9, 6, 1),
	('The Hobbit', '8586232181766', '1937', 'Gandalf tricks Bilbo Baggins into hosting a party for Thorin Oakenshield and his band of twelve dwarves (Dwalin, Balin, Kili, Fili, Dori, Nori, Ori, Oin, Gloin, Bifur, Bofur, and Bombur), who sing of reclaiming their ancient home, Lonely Mountain, and its vast treasure from the dragon Smaug. When the music ends, Gandalf unveils ThrÃ³r''s map showing a secret door into the Mountain and proposes that the dumbfounded Bilbo serve as the expedition''s burglar. The dwarves ridicule the idea, but Bilbo, indignant, joins despite himself.
	The group travels into the wild. Gandalf saves the company from trolls and leads them to Rivendell, where Elrond reveals more secrets from the map. When they attempt to cross the Misty Mountains, they are caught by goblins and driven deep underground. Although Gandalf rescues them, Bilbo gets separated from the others as they flee the goblins. Lost in the goblin tunnels, he stumbles across a mysterious ring and then encounters Gollum, who engages him in a game, each posing a riddle until one of them cannot solve it.', 
 	'data:image/jpeg;base64,', 0, 'en', 3, 9, 3),
 	('The Lord of the Rings', '0425466200482', '1954', 'Bilbo celebrates his eleventy-first (111th) birthday and leaves the Shire suddenly, passing the Ring to Frodo Baggins, his cousin and heir. Neither hobbit is aware of the Ring''s origin, but the wizard Gandalf suspects it is a Ring of Power. Seventeen years later, Gandalf tells Frodo that he has confirmed that the Ring is the one lost by the Dark Lord Sauron long ago and counsels him to take it away from the Shire. Gandalf leaves, promising to return by Frodo''s birthday and accompany him on his journey, but fails to do so.
	Frodo sets out on foot, offering a cover story of moving to Crickhollow, accompanied by his gardener Sam Gamgee and his cousin Pippin Took. They are pursued by mysterious Black Riders, but meet a passing group of Elves led by Gildor Inglorion, whose chants to Elbereth ward off the Riders. The hobbits spend the night with them, then take an evasive short cut the next day, and arrive at the farm of Farmer Maggot, who takes them to Bucklebury Ferry, where they meet their friend Merry Brandybuck.', 
 	'data:image/gif;base64,', 0, 'en', 6, 6, 3),
 	('The Silmarillion', '0430420673924', '1977', 'AinulindalÃ« (Quenya: The Music of the Ainur) takes the form of a primary creation narrative. Eru (The One), also called IlÃºvatar (Father of All), first created the Ainur, a group of eternal spirits or demiurges, called the offspring of his thought. IlÃºvatar brought the Ainur together and showed them a theme, from which he bade them make a great music. Melkorâwhom IlÃºvatar had given the greatest power and knowledge of all the Ainurâbroke from the harmony of the music to develop his own song. Some Ainur joined him, while others continued to follow IlÃºvatar, causing discord in the music. This happened three times, with Eru IlÃºvatar successfully overpowering his rebellious subordinate with a new theme each time. IlÃºvatar then stopped the music and showed them a vision of Arda and its peoples.', 
 	'data:image/png;base64,', 0, 'en', 3, 8, 3),
 	('Unfinished Tales', '2179146117727', '1980', 'Unlike The Silmarillion, also published posthumously (in 1977), for which the narrative fragments were modified to connect into a consistent and coherent work, the Unfinished Tales are presented as Tolkien left them, with little more than names changed (the author having had a confusing habit of trying out different names for a character while writing a draft). Thus some of these are incomplete stories, while others are collections of information about Middle-earth. Each tale is followed by a long series of notes explaining inconsistencies and obscure points.', 
 	'data:image/jpeg;base64,', 0, 'en', 6, 7, 3),
 	('Beowulf', '8211818677569', '1986', 'Tolkien begins by noting that the original book has almost been lost under the extensive literature (he uses scare quotes) on the subject. He explains that Beowulf had mainly been quarried as an historical document, and that most of the praise and censure of the poem was due to beliefs that it was something that it was not â for example, primitive, pagan, Teutonic, an allegory (political or mythical), or most often, an epic; or because the scholar would have liked it to be something else, such as a heathen heroic lay, a history of Sweden, a manual of Germanic antiquities, or a Nordic Summa Theologica. Tolkien gives an allegory of a man who inherits a field full of stone from an old hall. He builds a tower with some of it, but when people find the stones are older than the tower, they pull it down to look for hidden carvings and inscriptions.', 
 	'data:image/jpeg;base64,', 0, 'en', 1, 2, 3),
 	('And Then There Were None', '8690711662355', '1954', 'Eight people arrive on a small, isolated island off the Devon coast, each having received an unexpected personal invitation. They are met by the butler and cook-housekeeper, Thomas and Ethel Rogers, who explain that their hosts, Ulick Norman Owen and Una Nancy Owen, have not yet arrived, though they have left instructions.
	A framed copy of an old rhyme hangs in every guest''s room, and on the dining room table sit ten figurines. After supper, a phonograph record is played; the recording accuses each visitor and Mr and Mrs Rogers of having committed murder, then asks if any of the prisoners at the bar wishes to offer a defence.', 
 	'data:image/jpeg;base64,', 0, 'en', 9, 5, 4),
 	('The Mysterious Affair at Styles', '6204989873285', '1937', 'On the morning of 18 July, the household at Styles Court wakes to the discovery that Emily Inglethorp, the elderly owner, has died. She had been poisoned with strychnine. Arthur Hastings, a soldier from the Western Front staying at this country manor as a guest on his sick leave, ventures out to the nearby village of Styles St Mary to enlist help from his friend Hercule Poirot. Emily was a wealthy woman. Her household includes her husband, Alfred Inglethorp, a younger man she recently married; her stepsons (from her first husband''s previous marriage) John and Lawrence Cavendish; John''s wife Mary Cavendish; Cynthia Murdoch, the daughter of a deceased friend of the family; and Evelyn Howard, Emily''s companion.', 
 	'data:image/jpeg;base64,', 0, 'en', 2, 10, 4),
 	('Come, Tell Me How You Live', '1354475236292', '1946', 'Christie first thought of writing the book in 1938 and wrote to her literary agent, Edmund Cork, in July of that year, suggesting the tp2_GRUPO_03 and telling him that it would be not at all serious or archaeological. In the event, she wrote the book during the Second World War after her husband, Max Mallowan, had been posted to Egypt with the British Council in February 1942 and she was living alone in London. She occupied her hours by working in a hospital dispensary, using the knowledge she had gained doing the same job in the First World War working two full days, three half-days and alternate Saturday mornings and, The rest of the time, I wrote.', 
 	'data:image/jpeg;base64,', 0, 'en', 10, 12, 4),
 	('Boyhood', '6890442247579', '1929', 'Boyhood (Russian: ÐÑÑÐ¾ÑÐµÑÑÐ²Ð¾, Otrochestvo) is the second novel in Leo Tolstoy''s autobiographical trilogy, following Childhood and followed by Youth. The novel was first published in the Russian literary journal Sovremennik in 1854.', 
 	'data:image/jpeg;base64,', 0, 'ru', 7, 3, 5),
 	('A Calendar of Wisdom', '7673672897338', '1929', 'A Calendar of Wisdom (Russian: ÐÑÑÐ³ ÑÑÐµÐ½Ð¸Ñ, Krug chtenia), also known as Path of life, A Cycle of Readings or Wise Thoughts for Every Day, is a collection of insights and wisdom compiled by Leo Tolstoy between 1903 and 1911 that was published in three different editions. An English translation by Archibald J. Wolfe of the first Russian edition, which was organized by subject, was published in 1919. An English translation of the second Russian edition, which was organized by calendar date, was begun in 1911 as a monthly serial but abandoned after the first volume.', 
 	'data:image/jpeg;base64,', 0, 'ru', 10, 11, 5),
	('Animal Farm', '8056618251518', '1945', 'The poorly run Manor Farm near Willingdon, England, is ripened for rebellion from its animal populace by neglect at the hands of the irresponsible and alcoholic farmer, Mr. Jones. One night, the exalted boar, Old Major, holds a conference, at which he calls for the overthrow of humans and teaches the animals a revolutionary song called Beasts of England. When Old Major dies, two young pigs, Snowball and Napoleon, assume command and stage a revolt, driving Mr. Jones off the farm and renaming the property Animal Farm. They adopt the Seven Commandments of Animalism, the most important of which is, All animals are equal. The decree is painted in large letters on one side of the barn. Snowball teaches the animals to read and write, while Napoleon educates young puppies on the principles of Animalism. To commemorate the start of Animal Farm, Snowball raises a green flag with a white hoof and horn. Food is plentiful, and the farm runs smoothly. The pigs elevate themselves to positions of leadership and set aside special food items, ostensibly for their personal health.', 
 	'data:image/jpeg;base64,', 0, 'en', 7, 1, 6),
 	('Nineteen Eighty-Four', '2862170202747', '1949', 'In 1984, civilisation has been ravaged by world war, civil conflict, and revolution. Airstrip One (formerly known as Great Britain) is a province of Oceania, one of the three totalitarian super-states that rule the world. It is ruled by The Party under the ideology of Ingsoc (a Newspeak shortening of English Socialism) and the mysterious leader Big Brother, who has an intense cult of personality. The Party brutally purges out anyone who does not fully conform to their regime, using the Thought Police and constant surveillance through telescreens (two-way televisions), cameras, and hidden microphones. Those who fall out of favour with the Party become unpersons, disappearing with all evidence of their existence destroyed.', 
 	'data:image/webp;base64,', 0, 'en', 3, 11, 6),
 	('And to Think That I Saw It on Mulberry Street', '4862653300158', '1937', 'However, the only thing Marco has seen on his walk is a horse pulling a wagon on Mulberry Street. To make his story more interesting, Marco imagines a progressively more elaborate scene. He imagines the horse is first a zebra, then a reindeer, then an elephant, and finally, an elephant helped by two giraffes. The wagon changes to a chariot, then a sled, then a cart holding a brass band.', 
 	'data:image/png;base64,', 0, 'en', 1, 3, 7),
 	('Ulysses', '2987936784400', '1977', 'Ulysses is a modernist novel by Irish writer James Joyce. Parts of it were first serialized in the American journal The Little Review from March 1918 to December 1920, and the entire work was published in Paris by Sylvia Beach on 2 February 1922, Joyce''s 40th birthday. It is considered one of the most important works of modernist literature and has been called a demonstration and summation of the entire movement. According to Declan Kiberd, Before Joyce, no writer of fiction had so foregrounded the process of thinking.', 
 	'data:image/jpeg;base64,', 0, 'en', 11, 5, 8),
 	('The Lion, the Witch and the Wardrobe', '0985350773320', '1986', 'Peter, Susan, Edmund and Lucy Pevensie are evacuated from London in 1940, to escape the Blitz, and sent to live with Professor Digory Kirke at a large house in the English countryside. While exploring the house, Lucy enters a wardrobe and discovers the magical world of Narnia. Here, she meets the faun named Tumnus, whom she addresses as Mr. Tumnus. Tumnus invites her to his cave for tea and admits that he intended to report Lucy to the White Witch, the false ruler of Narnia who has kept the land in perpetual winter, but he repents and guides her back home. Although Lucy''s siblings initially disbelieve her story of Narnia, Edmund follows her into the wardrobe and winds up in a separate area of Narnia and meets the White Witch, who calls herself the Queen of Narnia. The Witch plies Edmund with Turkish delight and persuades him to bring his siblings to her with the promise of being made a prince. Edmund reunites with Lucy and they both return home. ', 
 	'data:image/jpeg;base64,', 0, 'en', 1, 2, 9),
 	('Prince Caspian', '2356771758469', '1926', 'Peter, Susan, Edmund, and Lucy Pevensie are magically whisked away from a British railway station to a beach near an old and ruined castle. They determine the ruin is Cair Paravel, where they once ruled as the kings and queens of Narnia. They discover the treasure vault where Peter''s sword and shield, Susan''s bow and arrows, and Lucy''s dagger and bottle of magical cordial are stored. Susan''s horn for summoning help is missing, as she left it in the woods the day they returned to England after their prior visit to Narnia. Although only a year has passed in England, 1300 years have passed in Narnia.', 
 	'data:image/jpeg;base64,', 0, 'en', 4, 1, 9),
 	('Pride and Prejudice', '9471409358899', '1940', 'In the early 19th century, the Bennet family live at their Longbourn estate, situated near the village of Meryton in Hertfordshire, England. Mrs. Bennet''s greatest desire is to marry off her five daughters in order to secure their futures. The arrival of Mr. Bingley, a rich bachelor who rents the neighbouring Netherfield estate, gives her hope that one of her daughters might contract an advantageous marriage, because It is a truth universally acknowledged, that a single man in possession of a good fortune, must be in want of a wife.', 
 	'data:image/jpeg;base64,', 0, 'en', 6, 11, 10),
 	('Charlie and the Chocolate Factory', '7837241844582', '1974', 'Eleven-year-old Charlie Bucket, his parents, and four grandparents all live in poverty in a small house outside a town which is home to a large, world-famous chocolate factory. One day, Charlie''s Grandpa Joe tells him about the legendary and eccentric chocolatier Willy Wonka, who owns the town''s chocolate factory, and all the fantasy candies he made until the other chocolatiers sent in spies to steal his secret recipes, forcing Wonka to close the factory. He reopened the factory three years later, but the gates remained locked and nobody is sure who is providing the factory with its workforce.', 
 	'data:image/jpeg;base64,', 0, 'en', 5, 6, 11),
 	('One Hundred Years of Solitude', '1877431011989', '1929', 'One Hundred Years of Solitude is the story of seven generations of the BuendÃ­a Family in the town of Macondo. The founding patriarch of Macondo, JosÃ© Arcadio BuendÃ­a, and Ãrsula IguarÃ¡n, his wife (and first cousin), leave their hometown in Riohacha, Colombia, after JosÃ© Arcadio kills Prudencio Aguilar after a cockfight for suggesting JosÃ© Arcadio was impotent. One night of their emigration journey, while camping on a riverbank, JosÃ© Arcadio dreams of Macondo, a city of mirrors that reflected the world in and about it. Upon awakening, he decides to establish Macondo at the riverside; after days of wandering the jungle, his founding of Macondo is utopic.', 
 	'data:image/jpeg;base64,', 0, 'sp', 7, 11, 12),
 	('Chronicle of a Death Foretold', '2779709071013', '1937', 'The book is a nonlinear narrative told by an anonymous narrator and begins on the morning of Santiago Nasar''s death. The reader learns that Santiago lives with his mother, Placida Linero; the cook, Victoria Guzman; and the cook''s daughter, Divina Flor. Santiago took over the successful family ranch after the death of his father Ibrahim, who was of Arab origin. He returns home in the early morning hours from an all-night celebration of a wedding between a recent newcomer, Bayardo San Roman, and a long-term resident, Angela Vicario. Two hours after the wedding, Angela was dragged back to her mother''s home by Bayardo because she was not a virgin. After a beating from her mother, Angela is forced to reveal the name of the man who has defiled her purity and honor. In a somewhat spurious manner, she reveals the man to be Santiago. To avenge their family honor, her twin brothers Pablo and Pedro Vicario decide to kill Santiago using knives that they''d previously used to slaughter pigs.', 
 	'data:image/jpeg;base64,', 0, 'sp', 9, 12, 12),
	('Oliver Twist', '5346313238015', '1983', 'Oliver Twist, or the Parish Boy''s Progress, Charles Dickens''s second novel, was published as a serial from 1837 to 1839, and as a three-volume book in 1838. Born in a workhouse, the orphan Oliver Twist is bound into apprenticeship with an undertaker. After escaping, Oliver travels to London, where he meets the Artful Dodger, a member of a gang of juvenile pickpockets led by the elderly criminal Fagin.
	Oliver Twist unromantically portrays the sordid lives of criminals, and exposes the cruel treatment of the many orphans in London in the mid-19th century. The alternative title, The Parish Boy''s Progress, alludes to Bunyan''s The Pilgrim''s Progress, as well as the 18th-century caricature series by painter William Hogarth, A Rake''s Progress and A Harlot''s Progress.', 
 	'data:image/jpeg;base64,', 0, 'en', 3, 5, 13),
 	('Alice''s Adventures in Wonderland', '2410771958361', '1974', 'A young girl named Alice sits bored by a riverbank, where she suddenly spots a White Rabbit with a pocket watch and waistcoat lamenting that he is late. The surprised Alice follows him down a rabbit hole, which sends her down a lengthy plummet but to a safe landing. Inside a room with a table, she finds a key to a tiny door, beyond which is a beautiful garden. As she ponders how to fit through the door, she discovers a bottle reading Drink me. Alice hesitantly drinks a portion of the bottle''s contents, and to her astonishment, she shrinks small enough to enter the door. However, she had left the key upon the table and is unable to reach it. ', 
 	'data:image/jpeg;base64,', 0, 'en', 4, 6, 14),
 	('East of Eden', '5121219349771', '1985', 'The story is primarily set in the Salinas Valley, California, between the beginning of the twentieth century and the end of World War I, though some chapters are set in Connecticut and Massachusetts, and the story goes as far back as the American Civil War.
	In the beginning of East of Eden, before introducing his characters, Steinbeck carefully establishes the setting with a description of the Salinas Valley in Central California.
	Then he outlines the story of the warmhearted inventor and farmer Samuel Hamilton and his wife Liza, immigrants from Ireland. He describes how they raise their nine children on a rough, infertile piece of land. As the Hamilton children begin to grow up and leave the nest, a wealthy stranger, Adam Trask, purchases the best ranch in the Valley.', 
 	'data:image/jpeg;base64,', 0, 'en', 1, 7, 15),
 	('The Premature Burial', '2229599406030', '1977', 'In The Premature Burial, the first-person unnamed narrator describes his struggle with things such as attacks of the singular disorder which physicians have agreed to term catalepsy, a condition where he randomly falls into a death-like trance. This leads to his fear of being buried alive (The  wretchedness, he says, is to be buried while alive). He emphasizes his fear by mentioning several people who have been buried alive. In the first case, the tragic accident was only discovered much later, when the victim''s crypt was reopened. In others, victims revived and were able to draw attention to themselves in time to be freed from their ghastly prisons.', 
 	'data:image/jpeg;base64,', 0, 'en', 11, 7, 16),
 	('The Mystery of Marie RogÃªt', '6589531689723', '1926', 'Poe''s detective character C. Auguste Dupin and his assistant, the unnamed narrator, undertake the unsolved murder of Marie RogÃªt in Paris. The body of RogÃªt, a perfume shop employee, is found in the Seine, and the press takes a keen interest in the mystery. Dupin remarks that the newspapers create a sensation ... [rather] than to further the cause of truth. Even so, he uses the newspaper reports to get into the mind of the murderer.
	Dupin rejects the popular theory blaming the murder on a gang of ruffians seen in the area around the time of RogÃªt''s disappearance. One of such a group, he reasons, would have certainly confessed to the crime due to fear of betrayal rather than a bothered conscience.', 
 	'data:image/jpeg;base64,', 0, 'en', 5, 8, 16),
 	('Romeo and Juliet', '4049573436158', '1926', 'The play, set in Verona, Italy, begins with a street brawl between Montague and Capulet servants who, like the masters they serve, are sworn enemies. Prince Escalus of Verona intervenes and declares that further breach of the peace will be punishable by death. Later, Count Paris talks to Capulet about marrying his daughter Juliet, but Capulet asks Paris to wait another two years and invites him to attend a planned Capulet ball. Lady Capulet and Juliet''s Nurse try to persuade Juliet to accept Paris''s courtship.
	Meanwhile, Benvolio talks with his cousin Romeo, Montague''s son, about Romeo''s recent depression. Benvolio discovers that it stems from unrequited infatuation for a girl named Rosaline, one of Capulet''s nieces. Persuaded by Benvolio and Mercutio, Romeo attends the ball at the Capulet house in hopes of meeting Rosaline. However, Romeo instead meets and falls in love with Juliet. Juliet''s cousin, Tybalt, is enraged at Romeo for sneaking into the ball but is only stopped from killing Romeo by Juliet''s father, who does not wish to shed blood in his house.', 
 	'data:image/jpeg;base64,', 0, 'en', 4, 4, 17),
 	('Canon of Sherlock Holmes', '6719731349008', '1954', 'Traditionally, the canon of Sherlock Holmes consists of the 56 short stories and four novels written by Sir Arthur Conan Doyle. In this context, the term canon is an attempt to distinguish between Doyle''s original works and subsequent works by other authors using the same characters.
	Usually capitalized by aficionados of the Sherlockian game as the Canon, the description of these 60 adventures as the Sherlock Holmes canon and the game of applying the methods of Higher Criticism to it was started by Ronald Knox as a playful use of the traditional definition of canon as an authoritative list of books accepted as holy scripture.', 
 	'data:image/jpeg;base64,', 0, 'en', 6, 9, 18),
 	('Harry Potter and the Philosopher''s Stone', '2586251858548', '1945', 'Harry Potter lives with his abusive aunt and uncle, Vernon and Petunia Dursley and their bullying son, Dudley. On Harry''s eleventh birthday, a half-giant named Rubeus Hagrid personally delivers an acceptance letter to Hogwarts School of Witchcraft and Wizardry, revealing that Harry''s parents, James and Lily Potter, were wizards. When Harry was one year old, an evil and powerful dark wizard, Lord Voldemort, murdered his parents. Harry survived Voldemort''s killing curse that rebounded off his forehead and seemingly destroyed the Dark Lord, leaving a lightning bolt-shaped scar on his forehead. Unknown to Harry, he is famous in the wizarding world.
	Hagrid takes Harry to Diagon Alley, the hidden wizard commerce and retail section in London. Harry''s parents have left him a fortune kept in Gringotts Wizarding Bank. Harry buys school supplies and a wand from Ollivander. The cores of Harry and Lord Voldemort''s wands have feathers from the same phoenix bird, making them brothers. Hagrid gives Harry an owl that he names Hedwig.', 
 	'data:image/jpeg;base64,', 0, 'en', 8, 2, 19),
 	('Harry Potter and the Chamber of Secrets', '1788070037443', '1949', 'While spending the summer at the Dursleys, twelve-year-old Harry Potter is visited by a house-elf named Dobby. He warns that Harry is in danger and must not return to Hogwarts. Harry refuses, so Dobby magically ruins Aunt Petunia and Uncle Vernon''s dinner party. A furious Uncle Vernon locks Harry into his room in retaliation. The Ministry of Magic immediately sends a notice accusing Harry of performing underage magic and threatening dismissal from Hogwarts.
	Ron Weasley and his brothers, Fred and George, arrive in their father''s flying Ford Anglia and rescue Harry, taking him to the Weasley home. Harry and the entire Weasley family travel to Diagon Alley for school supplies. They run into Hermione Granger and meet Lucius Malfoy, father of Harry''s nemesis Draco, and also Gilderoy Lockhart, a conceited autobiographer and adventurer who is the new Defence Against the Dark Arts professor. At King''s Cross station, Harry and Ron are unable to enter Platform 9Â¾ and miss the Hogwarts Express.', 
 	'data:image/jpeg;base64,', 0, 'en', 9, 3, 19),
 	('The Great Gatsby', '7113766366619', '1937', 'In spring 1922, Nick Carrawayâa Yale alumnus from the Midwest and a World War I veteranâjourneys to New York City to obtain employment as a bond salesman. He rents a bungalow in the Long Island village of West Egg, next to a luxurious estate inhabited by Jay Gatsby, an enigmatic multi-millionaire who hosts dazzling soirÃ©es yet doesn''t partake in them.
	One evening, Nick dines with a distant relative, Daisy Buchanan, in the fashionable town of East Egg. Daisy is married to Tom Buchanan, formerly a Yale football star whom Nick knew during his college days. The couple has recently relocated from Chicago to a mansion directly across the bay from Gatsby''s estate. There, Nick encounters Jordan Baker, an insolent flapper and golf champion who is a childhood friend of Daisy''s. Jordan confides to Nick that Tom keeps a mistress, Myrtle Wilson, who brazenly telephones him at his home and who lives in the valley of ashes, a sprawling refuse dump.', 
 	'data:image/jpeg;base64,', 0, 'en', 11, 6, 20);
  
